import React from 'react';
import DuplaItem from './DuplasItem';

const DuplasList = ({ duplas, onAddDupla, onRemoveDupla }) => {
  const handleAddDupla = () => {
    const jogador1 = prompt('Nome do Jogador 1');
    const jogador2 = prompt('Nome do Jogador 2');
    if (jogador1 && jogador2) {
      onAddDupla([jogador1, jogador2]);
    }
  };

  return (
    <div>
      <ul>
        {duplas.map((dupla, index) => (
          <DuplaItem key={index} dupla={dupla} index={index} onRemove={() => onRemoveDupla(index)} />
        ))}
      </ul>
    </div>
  );
};

export default DuplasList;
